      | 353904 -> { ItemTypeData.id= 353904; name= "Limbus"; published= false; description= "The Light Attack Vehicle (LAV) represents a new generation of mobile support vehicle, an agile and effective unit, adept at assisting both infantry and other vehicles on the battlefield with its cadre of electronic warfare subsystems and all-terrain maneuverability modules. Whether employed as a scout vehicle or as an anti-infantry unit, the LAV is a ubiquitous part of New Eden's modern battlefield.    The Logistics is equipped with superior armor and shield plating allowing it to withstand more punishment. Additionally, each Logistics LAV comes with a built-in special edition infantry repair tool, allowing it to support multiple allies at the same time. This particular model comes with built-in remote armor repairing functionality."; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
