      | 354583 -> { ItemTypeData.id= 354583; name= "Shotgun"; published= false; description= "Designed for close-range combat, the shotgun is a spread weapon with tremendous stopping power. Unlike traditional cyclotron designs, a walled centrifugal well is used to simultaneously shunt dozens of plasma charges, generating a wide-pattern ‘kill spread' that is lethal over short distances.  The excessive recoil produced by each discharge is absorbed by the pneumatic armature, allowing the weapon to be fired repeatedly without significant injury to the user. The operator controlled crank-action flushes coolant through the interior well before cycling additional rounds into the chamber."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 355262 -> { ItemTypeData.id= 355262; name= "'Broadside' MH-82 Heavy Machine Gun"; published= false; description= "A multi-barrel, rotary drive machine gun, the HMG is a singularly devastating anti-infantry weapon. Eschewing the advantages of a lighter frame in favor of stopping power, the exponentially increased heat and vibration produced by this Boundless Creation developed weapon makes it almost unbearable to fire. Yet despite this fact, its above average hit ratio and extreme rate of fire has earned it the nickname “Death's Engine.”  Unlike earlier models, the weapon requires no spool up time; rounds are expelled the instant the trigger is pressed. This comes at the cost of initially reduced accuracy as the counter-rotating drives slowly align. Once fully aligned, however, the HMG produces a pinpoint stream of gunfire with unmatched killing potential."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
