      | 355844 -> { ItemTypeData.id= 355844; name= "20GJ Compressed Particle Cannon"; published= false; description= "The railgun weaponizes velocity by using magnetic fields to accelerate projectiles to hypersonic speeds. "; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356038 -> { ItemTypeData.id= 356038; name= "'Fossil' Logistics M-I"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.  Utilizing a combination of high- and low-tech equipment, operators of the logistics suit are able to make effective repairs to installations, vehicles, and even other soldiers; every apparatus required for field triage is present and easily accessible from the utility pockets and satchels attached to the suit. Its hydraulic assisted exoskeleton allows the wearer to effortlessly hoist heavy equipment, while the helmet is packed with material scanners sensitive enough to spot microfractures in layered steel.  When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356426 -> { ItemTypeData.id= 356426; name= "Nova Knives"; published= false; description= "A close-quarters melee weapon, the nova knife is as deadly a weapon as anything on the battlefield. Its name derives from the heated plasma edge of the blade – formed by a thermic igniter and linear gravity condenser – that, in skilled hands, can be used to carve through even the thickest dropsuit armor."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356620 -> { ItemTypeData.id= 356620; name= "'Neo' Scout G/1-Series"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.  This high-tech suit is coated in adaptive camouflage, a thin layer of bio-hermetic membranes interwoven with microscopic optical sensors that control millions of individual pigment ferro-crystals. An integrated AI-53 “All Eyes” sensor system wraps around the inside of the helmet, which also includes a chemically scrubbed atmospheric filtration system.  When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 35841 -> { ItemTypeData.id= 35841; name= "Ansiblex Jump Gate"; published= true; description= "Designed by the Upwell Consortium to function as the successor and improvement over starbase jump bridges, the Ansiblex Jump Gate is the flagship of their new Fast Logistical EXpansion (FLEX) structures product line.    The Ansiblex enables point-to-point FTL travel even for ships that lack their own jump drives, and a matched pair of gates provides a transport connection between two star systems within its operational range, using stabilized spatiotemporal tunneling. The Ansiblex makes a large number of improvements over the older jump bridge portal devices, and incorporates some elements of Triglavian Collective space-time conduit technology in its workings.    Each Ansiblex Jump Gate structure is automatically equipped with one <a href=showinfo:35913>Standup Conduit Generator I</a> service module. This service module may only be onlined in a system that contains an Infrastructure Hub with the <a href=showinfo:32422>Advanced Logistics Network</a> upgrade active.    May not be deployed within 500km of another Upwell Structure, or 1000km of Stargates, Stations, or Starbases. A maximum of one Jump Gate may be deployed per system."; marketGroupId= Some(2511); groupId= 1408; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 2112; value= 0.000010 }; { DogmaAttributeValueData.attributeId = 2114; value= 0.000010 }; { DogmaAttributeValueData.attributeId = 263; value= 750000.000000 }; { DogmaAttributeValueData.attributeId = 136; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 3000000.000000 }; { DogmaAttributeValueData.attributeId = 11; value= 20000.000000 }; { DogmaAttributeValueData.attributeId = 12; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 13; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 14; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 271; value= 0.800000 }; { DogmaAttributeValueData.attributeI