      | 364380 -> { ItemTypeData.id= 364380; name= "Amarok"; published= false; description= "The Dropship is a two-engine VTOL craft that combines advances in shielded hardware, redundant software protocols, and networked aeronautics into a heavily armored tactical platform capable of insertion and extraction in even the most hostile situations. Its standard five-man carrying capacity, dual hardpoints, and reinforced plating allow it to operate independently in any situation, alternately tracking and engaging enemy targets and ferrying troops into and out of harm’s way.    The Bomber class is a tactical unit designed to eradicate heavy ground units and installations. While the increased bulk of the payload and augmented hull affect maneuverability and limit its ability to engage aerial targets, with accurate bombing it remains a singularly devastating means of engaging ground targets.      "; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 364477 -> { ItemTypeData.id= 364477; name= "Staff Recruiter Active Booster (7-Day)"; published= false; description= "Boosters are biomechanical grafts designed to stimulate nerve growth and neurotransmitter activity, temporarily increasing cognitive processes. The graft will degrade over time until it is completely absorbed by the body and ceases to function.    Active Boosters add a percentage bonus to the number of skill points earned at the end of each battle. They do not increase the number of skill points remaining in the active skill point pool."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
